// src/pages/home.js
import React from "react";
import homepage from "../data/sitedata.js";
import Link from '../components/Link';


const Home = () => {
  return (
    <div>
      <div className="hero">
        <div className="five columns">
          <h1>Andrew Fitzpatrick</h1><h2>.rocks</h2>
        </div>
        <div className="seven columns">
          <img src={require('../images/fitz_pic.jpg')} className="heroImage" alt="Andrew Fitzpatrick rocks"/>
        </div>
      </div>
      <div className="fitzfolio full-width"><h2>FITZ-FOLIO</h2></div>
      <div>
      {
          homepage.map((item, i) => (
            <div className = "home-port" key={i}>
              <Link to = {item.link} key={i}>
                <h4>{item.company}</h4>
              </Link>
                <div><h4>{item.title}</h4></div>
                <div><h4>{item.date}</h4></div>
            </div>
          ))
        }
      </div>
    </div>
  );
};

export default Home;
